import "../index.css";

export default class Seleccion extends Component {
  render() {
    return (
      <div>
        <MDBCol sm="3">
          <MDBRow id="btn" center >
            <MDBBtn block color="orange">Salir</MDBBtn>
          </MDBRow>
          <MDBRow id="relleno">
